import { registerUrl } from '../config/config.json'

const signIn = async (data: any) => {
  try {

    const response = await axios.post(registerUrl, data);
    console.log(response.data);

  } catch (error) {
  }

}


const signUp = async (data: any) => {
  try {

    const response = await axios.post(registerUrl, data);
    console.log(response.data);


  } catch (error) {
  }

}
export {
  signIn,
  signUp
}
